  true,\n\t\"url\": null,\n\t\"notes\": \"We use ambient noise correlation (ANC) to
  create a detailed image of the subsurface seismic velocity at the Newberry EGS site
  down to 5 km. We collected continuous data for the 22 stations in the Newberry network,
  together with 12 additional stations from the nearby CC, UO and UW networks. The
  data were instrument corrected, whitened and converted to single bit traces before
  cross correlation according to the methodology in Benson (2007). There are 231 unique
  paths connecting the 22 stations of the Newberry network. The additional networks
  extended that to 402 unique paths crossing beneath the Newberry site. \",\n\t\"license_title\":
